import React from 'react'

function WishesComponent({editInputWish,setUpdateWish,wishes, startwish, editWish, deleteWish, finishWish})  {
    return (
        <div >
            {
                wishes.map((wish) => {
                    return <WishesComponent/>
                })
            }
        </div>
    )
}

export default WishesComponent
